import React, { Component } from "react";

class Header extends Component {
  render() { var month = new Date().getMonth() + 1; var day = new Date().getDate(); var year = new Date().getFullYear();
  var date = moment()
      .utcOffset('+05:30')
      .format('YYYY-MM-DD hh:mm:ss a');
  return (
      <div className="text-center">
        <img
          src="https://seeklogo.com/images/H/healthy-eating-fork-and-knife-logo-0A8E8412A9-seeklogo.com.png"
          width="300"
          // className="img-thumbnail"
          style={{ marginTop: "20px" }}
        />
        <hr />
        <h5>
          <i></i>
        </h5>
        <h1 style={{ marginBottom: "40px" }}>Food Eaten on: {month}/{day}/{year} {date}</h1>
      </div>
    );
  }
}

export default Header;
